function createContract(chain3, account, abiString, salonAbi, bytecodeString, salonbytecode) {
  try {
    console.log(chain3.isConnected());
    var abi = JSON.parse(abiString);
    var sAbi = JSON.parse(salonAbi);
    var tokenContract = chain3.mc.contract(abi);
    chain3.personal.unlockAccount(account, 'xxxx',12345);
    tokenContract.new("AnHui Blockchain Salon Token", "AHBC", 18, {
      data: bytecodeString,
      gasPrice:20000000000,
      gas: 8000000,
      from: account
    }, function (err, myContract) {
      if (!err) {
        // NOTE: The callback will fire twice!
        // Once the contract has the transactionHash property set and once its deployed on an address.

        // e.g. check tx hash on the first call (transaction send)
        if (!myContract.address) {
          console.log(myContract.transactionHash) // The hash of the transaction, which deploys the contract

          // check address on the second call (contract deployed)
        } else {
          console.log("token:" + myContract.address) // the contract address
          var salonContract = chain3.mc.contract(sAbi);
          salonContract.new(myContract.address, {
            data: salonbytecode,
            gasPrice:20000000000,
            gas: 8000000,
            from: account
          }, function (err, myContract) {
            if (!err) {
              if (!myContract.address) {
                console.log(myContract.transactionHash)
              } else {
                console.log("salon:" + myContract.address)
              }
            }
          });
        }
      }
    });
  } catch (error) {
    console.log(error);
  }
}

